.el-basic-detail {
  width: 100%;
  background-color: #FFFFFF;
  color: #222222;
  tr td {
    width: 25%;
    height: 40px;
    box-sizing: border-box;
    border: 1px solid #D7D9E2;
    line-height: 36px;
    font-size: 13px !important;
    text-align: center;
  }

  tr td:nth-child(odd) {
    font-weight: bold;
    background-color: #E3F2FD;
  }
}

.el-table-title {
  margin: 1rem 0;
  font-size: 14px;
  color: #333;
}
